INSERT INTO `catering` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
(1, 'Athula Caterers', 'At Athula Caterers (Pvt) Ltd, we pride ourselves on professionalism and exceptional customer care. We offer a variety of menu options for you. Itâ€™s our job to make it as easy as possible for you, so that you can enjoy the planning process and your reception too!<br><br>\r\nOur Menu Packages Include:<br>\r\nFine linens with color options<br>\r\nA china package with color and pattern options<br>\r\nFlatware & Water Goblets<br>\r\nExtra plates and cutlery for cake service<br>\r\nProfessionally trained catering staff<br>\r\nBoth buffet style-dining and sit-down dinners<br>\r\n\r\n', '200000.00', , '0112925455', 'info@athulacaterers.com', 'www.athulacaterers.com\r\n');
INSERT INTO `catering` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
(2, 'Raffles Catering', 'Raffles Catering is truly a one-stop-shop for all catering needs. For weddings, corporate events, and private parties that require full-service catering, we offer award-winning culinary services, genuine hospitality, and skilled bartending. For smaller gatherings, we offer express, drop-off catering for breakfast, lunch, dinner, or dessert. We provide a full menu of trays from our deli and bakery, as well as boxed lunches, desserts, and cuisine from our sister restaurant, Two Olives. Express catering is perfect for gatherings that do not require full-service can be coordinated quickly for delivery or pickup. From full-service events to intimate gatherings, our team will handle every detail so you can feel like a guest at your own celebration. We strive to be recognized in the community as a real difference-maker when it comes to ensuring the event will be a cherished experience.\r\n', '150000.00', , '0112818776', 'sales@rafflescolombo.com', 'https://rafflescolombo.com');
INSERT INTO `catering` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
(3, 'Warna Caterers', 'The dedicated planners at Warna Caterers know that no two weddings are the same. This is why they work closely with each couple to craft a personalized dining experience worthy of their once-in-lifetime occasion. They are more than happy to accommodate any dietary requirements to create your perfect wedding menu. Their comprehensive list of services includes plated meals, buffets, appetizers, full bar service, signature desserts, family recipes, glassware, flatware, linens and more.\r\n', '175000.00', , '0114920180', 'info@warnacaterers.com', 'https://warnacaterers.com/\r\n');
INSERT INTO `catering` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
(4, 'Sarath Caterers', 'Sarath Caterers has had the pleasure of serving thousands of private parties, corporate gatherings, and wedding receptions. They devise delicious menus that are tailored to suit any event, from hors d\'oeuvres and buffet stations to plated meals. A snapshot of hot and cold appetizers includes mini crab cakes, grilled oysters, lobster rolls, and Caprese skewers. Grazing tables and charcuterie displays feature mouth-watering options such as cured meats, premium cheeses, and crostini. Chef-attended stations are ideal for large soirÃ©es and include Tuscan pasta bar and pot pie stations among other sumptuous choices. Couples can select their desired menu and enjoy entrÃ©es and dessert displays. The expert chefs will endeavor to tailor their talents to reflect your preferences.\r\n', '100000.00', , '0777537052', 'info@sarathcaterers.lk', 'https://sarathcaterers.com\r\n');
INSERT INTO `catering` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
(5, 'Tasty Caterers', 'Tasty Caterers is a full service caterer. With the ability to accommodate events from an intimate gathering to a lavish banquet up to 10,000 guests, we offer premium quality food, exceptional service and unmatched professionalism at prices that cater to your needs. We combine the best class with the most affordable pricing, making us a top catering choice in the Colombo area.<br><br>\r\nWe offer a wide variety of menus and planning services to ensure that your event will be one to remember. Our elegant style of catering can be tailored to your event of any size or budget.\r\n', '175000.00', , '0714456324', 'sales@tastycaterers.lk\r\n', 'https://www.tastycaterers.lk/\r\n');
INSERT INTO `catering` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
(6, 'Sponge Caterers', 'Sponge Caterers can provide plated meals, buffets, stations, family-style meals, hors d\'oeuvres and more. They provide options to accommodate gluten-free, nut-free, no pork, kosher, vegan and vegetarian diets. The catering company specializes in wedding receptions, rehearsal dinners, welcome and after parties, clambakes, picnics, barbecues and more.<br><br>\r\nSponge Caterers offers the following wedding catering services:<br>\r\nServers<br>\r\nDelivery<br>\r\nCleanup<br>\r\nCocktail reception<br>\r\nFull Bar Service<br>', '200000.00', , '0112574299', 'info@sponge.lk\r\n', 'https://www.sponge.lk');
INSERT INTO `catering` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
