INSERT INTO `catering` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
(8, 'Alumka Caterers', 'With over fifteen years of experience, Alumka Caterers is available to serve celebrations of all shapes and sizes. Chanu knows that each wedding is different, and she will tailor her services to fit your unique needs, budget, and taste preferences. From consultation to clean-up, she and her team will take care of every detail so that you can enjoy your special day to the absolute fullest.\r\n', '210000.00', , '0112435674', 'info@alumkacaterers.lk', 'http://alumkafood.lk\r\n');
INSERT INTO `catering` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact__number`, `email`, `website`) VALUES
